import './App.css';

function App() {
  return (
    <div className='main'>
      <div className='flex'>
        <div className='box_left'>aa</div>
        <div className='box_left'></div>
      </div>
      <div className='flex'>
        <div></div>
          <div className='box_right'></div>
          <div className='box_right'></div>
          <div className='box_right'></div>
          <div className='box_right'></div>
          <div className='box_right'></div>
      </div>
    </div>
  )
}

export default App;
